import React from 'react';

// 비밀번호 찾기 페이지
const FindPassword = () => {
    return (
        <div>
            <h2>비밀번호 찾기</h2>
            <p>가입하신 아이디와 이메일로 비밀번호를 재설정할 수 있습니다.</p>
        </div>
    );
};

export default FindPassword;
